import React, { useState } from "react";
import "./MyFeed.styles.css";
import Logo from "../../assets/Logo.svg";
import MyFeedIcn from "../../assets/MyFeedLogoIcon.svg";
import GroupsIcn from "../../assets/Group.svg";
import MessagesIcn from "../../assets/Topic.svg";
import BookmarksIcn from "../../assets/Bookmark.svg";
import MoreIcn from "../../assets/View More.svg";
import NotificationsIcn from "../../assets/Notification.svg";
import SettingsIcn from "../../assets/Settings.svg";
import CameraIcn from "../../assets/Camera.svg";
import CodeIcn from "../../assets/Code.svg";
import SentIcn from "../../assets/Sent.svg";
import MoreViewIcn from "../../assets/Group 15.svg";
import FeaturedIcn from "../../assets/Featured.svg";
import HeartIcn from "../../assets/Heart.svg";
import RisingIcn from "../../assets/Rising.svg";

const MyFeed = () => {
  const [panelActiveTab, setPanelActiveTab] = useState("My Feed");
  const [activeButton, setActiveButton] = useState("Following");
  const userData = [
    {
      username: "user_01",
      profile_pic_url:
        "https://via.placeholder.com/150/FF5733/FFFFFF?text=Profile+Pic+01",
    },
    {
      username: "user_02",
      profile_pic_url:
        "https://via.placeholder.com/150/33FF57/FFFFFF?text=Profile+Pic+02",
    },
    {
      username: "user_03",
      profile_pic_url:
        "https://via.placeholder.com/150/3357FF/FFFFFF?text=Profile+Pic+03",
    },
    {
      username: "user_04",
      profile_pic_url:
        "https://via.placeholder.com/150/FF33A5/FFFFFF?text=Profile+Pic+04",
    },
    {
      username: "user_05",
      profile_pic_url:
        "https://via.placeholder.com/150/A5FF33/FFFFFF?text=Profile+Pic+05",
    },
    {
      username: "user_06",
      profile_pic_url:
        "https://via.placeholder.com/150/FF5733/FFFFFF?text=Profile+Pic+06",
    },
    {
      username: "user_07",
      profile_pic_url:
        "https://via.placeholder.com/150/FF33FF/FFFFFF?text=Profile+Pic+07",
    },
    {
      username: "user_08",
      profile_pic_url:
        "https://via.placeholder.com/150/33FFB5/FFFFFF?text=Profile+Pic+08",
    },
    {
      username: "user_09",
      profile_pic_url:
        "https://via.placeholder.com/150/B533FF/FFFFFF?text=Profile+Pic+09",
    },
    {
      username: "user_10",
      profile_pic_url:
        "https://via.placeholder.com/150/FF5733/FFFFFF?text=Profile+Pic+10",
    },
  ];

  const postData = [
    {
        username: "user_01",
        profile_pic_url:
          "https://via.placeholder.com/150/FF5733/FFFFFF?text=Profile+Pic+01",
        timeStamp: "",
        postContent: [
            {
                text: "üßë‚Äçüíª I need to do these processes in order but I don't know how to go about doing this in NodeJs. I know this is a simple question but I am new to NodeJs so any help would be appreciated.",
            },
            {
                image: "",
            },
            {
                code: "true",
            }
        ]
    }
  ]

  return (
    <div className="myFeed-container">
      <header className="myFeed-header">
        <img src={Logo} alt="Logo" />
        <input type="text" placeholder="Search" />
        <div className="myFeed-header-right">
          <a href="#">Discuss</a>
          <a href="#">Discover</a>
          <a href="#">Hackathons</a>
        </div>
      </header>
      <div className="myFeed-header-divider" />
      <div className="myFeed-content">
        <div className="myFeed-content-col1">
          <div className="myFeed-col1-contents">
            <ul>
              <li>
                <img src={MyFeedIcn} alt="my-feed-icon" />
                <a href="#">My Feed</a>
              </li>
              <li>
                <img src={GroupsIcn} alt="groups-icon" />
                <a href="#">Groups</a>
              </li>
              <li>
                <img src={MessagesIcn} alt="Logo" />
                <a href="#">Messages</a>
              </li>
              <li>
                <img src={BookmarksIcn} alt="Logo" />
                <a href="#">Bookmarks</a>
              </li>
              <li>
                <img src={MoreIcn} alt="Logo" />
                <a href="#">More</a>
              </li>
            </ul>
            <div className="myFeed-comp-divider" />
            <div className="myFeed-col1-contents">
              <ul>
                <li>
                  <img src={NotificationsIcn} alt="Logo" />
                  <a href="#">Notifications</a>
                </li>
                <li>
                  <img src={SettingsIcn} alt="Logo" />
                  <a href="#">Settings</a>
                </li>
              </ul>
            </div>
            <div className="myFeed-comp-divider" />
            <div className="myFeed-col1-contents">
              <ul>
                <li>
                  <img src="" alt="Logo" />
                  <a href="#">John Doe</a>
                </li>
              </ul>
            </div>
          </div>
        </div>
        <div className="myFeed-content-col2">
          <div className="myFeed-col2-contents-stories">
            {userData.map((user, index) => (
              <div key={index} className="myFeed-col2-contents-story">
                <img
                  className="story-profile-pic"
                  src={user.profile_pic_url}
                  alt="Profile Pic"
                />
                <p>@{user.username}</p>
              </div>
            ))}
          </div>
          <div className="myFeed-col2-contents-add-posts">
            <div className="add-posts-input">
              <textarea type="text" placeholder="New Post..." />
            </div>
            <div className="add-posts-options">
              <div className="add-posts-options-left">
                <a href="#">
                  <img src={CodeIcn} alt="Add Image" />
                </a>
                <a href="#">
                  <img src={CameraIcn} alt="Add Image" />
                </a>
                <a href="#">
                  <img src={MoreViewIcn} alt="Add Image" />
                </a>
              </div>
              <div className="add-posts-options-right">
                <a href="#">
                  <img src={SentIcn} alt="Add Image" />
                </a>
              </div>
            </div>
          </div>
          <div className="myFeed-col2-contents-details">
            <button
              onClick={() => setActiveButton("Following")}
              className={activeButton === "Following" ? "active" : ""}
            >
              <img src={HeartIcn} alt="Heart" />
              <span>Following</span>
            </button>
            <button
              onClick={() => setActiveButton("Featured")}
              className={activeButton === "Featured" ? "active" : ""}
            >
              <img src={FeaturedIcn} alt="Heart" />
              <span>Featured</span>
            </button>
            <button
              onClick={() => setActiveButton("Rising")}
              className={activeButton === "Rising" ? "active" : ""}
            >
              <img src={RisingIcn} alt="Heart" />
              <span>Rising</span>
            </button>
          </div>
          <div className="myFeed-col2-contents-posts">

          </div>
        </div>
        <div className="myFeed-content-col3"></div>
      </div>
    </div>
  );
};

export default MyFeed;
